import React from 'react';
import styled from 'styled-components';
import { motion } from 'framer-motion';

const IndustriesSection = styled.section`
  padding: 120px 0;
  background-color: #151515;
`;

const Container = styled.div`
  max-width: 1440px;
  margin: 0 auto;
  padding: 0 40px;
  
  @media (max-width: 768px) {
    padding: 0 24px;
  }
`;

const SectionHeader = styled.div`
  text-align: center;
  margin-bottom: 80px;
`;

const Title = styled(motion.h2)`
  font-size: 40px;
  font-weight: 600;
  color: #FFFFFF;
  margin-bottom: 24px;
  letter-spacing: -0.01em;
  
  @media (max-width: 768px) {
    font-size: 28px;
  }
`;

const IndustriesGrid = styled.div`
  display: grid;
  grid-template-columns: repeat(auto-fit, minmax(280px, 1fr));
  gap: 32px;
`;

const IndustryCard = styled(motion.div)`
  background: #2A2A2A;
  border: 1px solid #3A3A3A;
  padding: 32px;
  text-align: center;
  transition: all 0.3s ease;
  
  &:hover {
    border-color: #BFBFBF;
    transform: translateY(-4px);
  }
`;

const IndustryIcon = styled.div`
  font-size: 40px;
  margin-bottom: 20px;
  height: 60px;
  display: flex;
  align-items: center;
  justify-content: center;
`;

const IndustryTitle = styled.h3`
  font-size: 20px;
  font-weight: 600;
  color: #FFFFFF;
  margin-bottom: 12px;
`;

const IndustryDescription = styled.p`
  font-size: 14px;
  color: #E0E0E0;
  font-weight: 300;
  line-height: 1.5;
`;

const Industries = () => {
  const industries = [
    {
      id: 1,
      icon: 'üè¢',
      title: '–ù–µ–¥–≤–∏–∂–∏–º–æ—Å—Ç—å',
      description: '–°–∞–π—Ç—ã –¥–ª—è –¥–µ–≤–µ–ª–æ–ø–µ—Ä–æ–≤, —Ä–∏–µ–ª—Ç–æ—Ä—Å–∫–∏—Ö –∞–≥–µ–Ω—Ç—Å—Ç–≤ –∏ –∂–∏–ª—ã—Ö –∫–æ–º–ø–ª–µ–∫—Å–æ–≤'
    },
    {
      id: 2,
      icon: 'üíª',
      title: 'IT –∏ SaaS',
      description: '–ü—Ä–æ–¥—É–∫—Ç–æ–≤—ã–π –¥–∏–∑–∞–π–Ω –¥–ª—è —Ç–µ—Ö–Ω–æ–ª–æ–≥–∏—á–µ—Å–∫–∏—Ö —Å—Ç–∞—Ä—Ç–∞–ø–æ–≤ –∏ —Å–µ—Ä–≤–∏—Å–æ–≤'
    },
    {
      id: 3,
      icon: 'üõí',
      title: 'E-commerce –∏ —Ä–∏—Ç–µ–π–ª',
      description: '–ò–Ω—Ç–µ—Ä–Ω–µ—Ç-–º–∞–≥–∞–∑–∏–Ω—ã –∏ –ø–ª–∞—Ç—Ñ–æ—Ä–º—ã –¥–ª—è –æ–Ω–ª–∞–π–Ω-—Ç–æ—Ä–≥–æ–≤–ª–∏'
    },
    {
      id: 4,
      icon: 'üí∞',
      title: '–§–∏–Ω–∞–Ω—Å—ã',
      description: '–†–µ—à–µ–Ω–∏—è –¥–ª—è –±–∞–Ω–∫–æ–≤, —Ñ–∏–Ω—Ç–µ—Ö–∞ –∏ –∏–Ω–≤–µ—Å—Ç–∏—Ü–∏–æ–Ω–Ω—ã—Ö –∫–æ–º–ø–∞–Ω–∏–π'
    },
    {
      id: 5,
      icon: '‚úàÔ∏è',
      title: '–¢—É—Ä–∏–∑–º',
      description: '–°–∞–π—Ç—ã –¥–ª—è —Ç—É—Ä–æ–ø–µ—Ä–∞—Ç–æ—Ä–æ–≤, –æ—Ç–µ–ª–µ–π –∏ —Ç—É—Ä–∏—Å—Ç–∏—á–µ—Å–∫–∏—Ö —Å–µ—Ä–≤–∏—Å–æ–≤'
    }
  ];

  const containerVariants = {
    hidden: { opacity: 0 },
    visible: {
      opacity: 1,
      transition: {
        staggerChildren: 0.1
      }
    }
  };

  const itemVariants = {
    hidden: { opacity: 0, y: 20 },
    visible: { opacity: 1, y: 0 }
  };

  return (
    <IndustriesSection>
      <Container>
        <SectionHeader>
          <Title
            initial={{ opacity: 0, y: 30 }}
            whileInView={{ opacity: 1, y: 0 }}
            transition={{ duration: 0.8 }}
            viewport={{ once: true }}
          >
            –û–ø—ã—Ç –≤ —Ä–∞–∑–Ω—ã—Ö —Å—Ñ–µ—Ä–∞—Ö
          </Title>
        </SectionHeader>

        <IndustriesGrid
          as={motion.div}
          variants={containerVariants}
          initial="hidden"
          whileInView="visible"
          viewport={{ once: true }}
        >
          {industries.map((industry) => (
            <IndustryCard
              key={industry.id}
              variants={itemVariants}
              whileHover={{ scale: 1.02 }}
            >
              <IndustryIcon>{industry.icon}</IndustryIcon>
              <IndustryTitle>{industry.title}</IndustryTitle>
              <IndustryDescription>{industry.description}</IndustryDescription>
            </IndustryCard>
          ))}
        </IndustriesGrid>
      </Container>
    </IndustriesSection>
  );
};

export default Industries;
